const styles = (theme) => ({
  root: {
    display: 'flex',
    flexWrap: 'wrap',
    justifyContent: 'space-between',
    width: '100%',
    marginBottom: theme.spacing(1),
    alignItems: 'center',
  },
});

export default styles;
